import React from 'react'

export default function Character(props) {
  props = props.props
  return(
    <div class="character main">
      <img src="" alt={`Portrait: ${props.name}`} class="portrait"/>
      <div>Name: {props.name}</div>
      <div>Initiative: {props.initiative}</div>
    </div>
  )
}
